        markdown: "\"# Fortsätt dansa! \n\nI del 2, skapar du ditt eget projekt. Här
          finns inga huvudbryn - istället finns ett gäng projekt som visar olika sätt
          att skapa mer komplexa dansparties. \n\nDu kan göra dessa nivåer _i valfri
          ordning_. Hoppa runt och kolla på hur något gjordes på en tidigare nivå,
          eller kombinera koncept projekten emellan. Prova allt, välj en favorit,
          och lägg tiden på att lägga till saker till projektet så att det blir ditt
          eget. \n\n<a class=\"\"btn btn-large btn-primary next-stage submitButton
          pull-right\"\">Continue</a> \n\n<div class=\"\"clearfix\"\"></div>\n\n <div
